import { motion } from "framer-motion";
import { Link } from "react-router-dom";

const HomeNavbarDown = [
  "About",
  "Contact us",
  "Login",
  "Signup",
  "Forgot Password",
  "Dashboard",
];
const Paths = ["/aboute", "/contactus", "/", "/", "/", "/dashboard"];

const NavbarOtherPages = ({ controller }) => {
  return (
    <motion.div
      className="dropDown"
      animate={controller}
      whileHover={{ opacity: 1 }}
    >
      {HomeNavbarDown.map((e, i) => (
        <Link to={Paths[i]} className="dropDownItem" key={i}>
          <motion.spann
            whileHover={{ color: "#f2c14e" }}
            transition={{ duration: 0.1 }}
          >
            {e}
          </motion.spann>
        </Link>
      ))}
    </motion.div>
  );
};
export default NavbarOtherPages;
